//RentBike.jsx
import React, { useState } from 'react';

function RentBike() {
  const [showModal, setShowModal] = useState(false);

  const handleRentClick = () => {
    setShowModal(true);
  };

  const handleCloseModal = () => {
    setShowModal(false);
  };

  return (
    <div className="space-y-6">
      <h2 className="text-3xl font-bold text-green-600 dark:text-green-300">üèçÔ∏è Rent a Bike</h2>

      <p className="text-gray-700 dark:text-gray-300">
        Explore our fleet of bikes available for rent. Select your ride, upload your documents, and hit the road in style.
      </p>

      {/* Sample Bike Listing */}
      <div className="bg-gray-100 dark:bg-gray-800 p-6 rounded-lg shadow-md">
        <h3 className="text-xl font-semibold text-gray-900 dark:text-white">Royal Enfield Himalayan</h3>
        <p className="text-gray-700 dark:text-gray-300">üìç Hyderabad</p>
        <p className="text-gray-700 dark:text-gray-300">üí∏ ‚Çπ800/day</p>
        <button onClick={handleRentClick} className="mt-4 px-4 py-2 bg-green-600 hover:bg-green-700 text-white rounded-md">
          Rent Now
        </button>
      </div>

      {/* Booking Modal */}
      {showModal && (
        <div className="fixed inset-0 bg-black bg-opacity-50 flex items-center justify-center z-50">
          <div className="bg-white dark:bg-gray-900 p-6 rounded-lg shadow-lg w-96">
            <h3 className="text-xl font-bold mb-4">üìÖ Confirm Your Booking</h3>
            <form className="space-y-4">
              <input type="date" placeholder="Start Date" className="w-full p-2 rounded border" />
              <input type="date" placeholder="End Date" className="w-full p-2 rounded border" />
              <button type="submit" className="w-full py-2 bg-green-600 text-white rounded hover:bg-green-700">
                Confirm Booking
              </button>
            </form>
            <button onClick={handleCloseModal} className="mt-4 w-full py-2 bg-gray-500 text-white rounded hover:bg-gray-600">
              Cancel
            </button>
          </div>
        </div>
      )}
    </div>
  );
}

export default RentBike;
